import '../index.css';
import Header from './Header';
import Main from './Main';
import Footer from './Footer';
import PopupInfo from './PopupInfo';
import PopupAddImage from './PopupAddImage';
import PopupOpenCard from './PopupOpenCard';
import PopupWithSubmit from './PopupWithSubmit';
import PopupAvatarEdit from './PopupAvatarEdit';
// import React from 'react';

function App() {
  return (
    <div className="App">
        <body className="page">
        <Header />
        <Main />
        <Footer />
        <PopupAddImage />
        <PopupOpenCard />
        <PopupWithSubmit />
        <PopupAvatarEdit />

        {/* Попап добавления карточек */}
        <template className="template">
            <li className="card">
                <img className="card__image" src="" alt="Фото" />
                    <button className="card__del"></button>
                    <div className="card__items">
                        <h2 className="card__title"></h2>
                        <div className="card__item">
                            <button className="card__button"></button>
                            <p className="card__number-likes"></p>
                        </div>

                    </div>
            </li>
        </template>


        </body>
    </div>
  );
}

export default App;
